import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import { isNotEmptyArray } from '../utils/global-functions';

export const BannerCard = ({ imageUrl, id, images }) => {
  return (
    <Fragment>
      {
        isNotEmptyArray(images) && images.map((image, imageIndex) => {
          <div id={imageIndex} className='swiper-slide'>
            <img src={image.imageUrl || 'image/home/banner.jpg'} className='img-fluid' />
          </div>
        })

      }

    </Fragment>
  );
};

BannerCard.propTypes = {
  images: PropTypes.array
};
